class ImageToScan {
public:
    static string scan(int row);
};


const int N = n_font*26*2;
int letters[N][max_m];
int W[N], H[N];

int info_pointer;

void info_reset() {
    info_pointer = 0;
}

int info_next() {
    char r = info[info_pointer++];
    if (r == bad_char) r = good_char;
    return r - min_char;
}

void decode_info() {
    int _N = 0, n_max = 0, m_max = 0;
    info_reset();
    int sym = 0, tot = 0;
    for (int i = 0; i < n_font; i++) {
        for (int c = 0; c < 26; c++)
            for (int f = 0; f < 2; f++) {
                int m = W[_N] = info_next();
                int n = H[_N] = info_next();
                tot += m * n;
                sym ++;
                n_max = max(n, n_max);
                m_max = max(m, m_max);
                for (int st = 0; st < m; st++) {
                    letters[_N][st] = 0;
                    for (int k = 0; k < n; k += 6) {
                        int z = info_next();
                        letters[_N][st] += z << k;
                    }
                }
                _N++;
            }
    }
    cerr << "n is upto " << n_max << endl;
    cerr << "m is upto " << m_max << endl;
    cerr << tot << " " << sym << " " << tot / sym << endl;
}

int i, j, k, m, n, b, x, y, n_letter;
int open[1024];
vector<string> ret;

int pre[SIZE][SIZE];

inline int bit_count(int v) {
    v = v - ((v >> 1) & 0x55555555);
    v = (v & 0x33333333) + ((v >> 2) & 0x33333333);
    return ((v + (v >> 4) & 0xF0F0F0F) * 0x1010101) >> 24;
}

struct subset {
    int score;
    int k;
    int x, y;
    subset(int score, int k, int x, int y ) : score(score), k(k), x(x), y(y) {}
};

bool operator < (const subset& A, const subset& B) {
    if (A.score != B.score) return A.score > B.score;
    if (A.k != B.k) return A.k < B.k;
    if (A.x != B.x) return A.x < B.x;
    return A.y < B.y;
}
set<subset> S;
set<subset>::iterator it;

void pixel_hunt() {
    for (x = 0; x < m; x++) {
        for (y = 0; y < n; y++) {
            pre[x][y] = 0;
            for (k = 0; k < max_n && y + k < n; k++)
                if (ret[x][y + k] == '1')
                    pre[x][y] += (1<<k);
        }
    }

    int cnt = 0, hits = 0;
    for (x = 0; x < m; x++)
        for (y = 0; y < n; y++)
            for (k = 0; k < N; k++)
                if (x + W[k] <= m && y + H[k] <= n) {
                    int f = 1, match = 0, total = 0;
                    for (i = 0; (i < W[k]) && f; i++)
                        if ((letters[k][i] | pre[x+i][y]) != pre[x+i][y]) f = 0;
                        else if (open[x+i]) {
                            match += bit_count(letters[k][i]);
                            total += bit_count(pre[x+i][y] & ((1<<H[k])-1));
                        }
                    //if (match < total * 0.80) f = 0;

                    if (!f) continue;
                    S.insert( subset(match, k, x, y) );

                    cnt += f;
                }
    cerr << cnt << " matches to work on..." << endl;
}

void fill_subsets() {
    while (!S.empty()) {
        it = S.begin();
        int score = it->score;
        int x = it->x;
        int y = it->y;
        int k = it->k;

        if (score == 0) break;

        S.erase(it);


        int new_score = 0;
        int match = 0, total = 0;
        for (i = 0; i < W[k]; i++)
            if (open[x+i]) {
                for (j = 0; j < H[k]; j++) {
                    if (ret[x+i][y+j] == '1') total++;
                    if (ret[x+i][y+j] == '1' && (1<<j)&letters[k][i]) new_score++;
                }
            }

        if (new_score <= total * 0.5) continue;

        if (new_score != score)
            S.insert( subset(new_score, k, x, y) );
        else {
            for (i = 0; i < W[k]; i++)
                if (open[x+i]) {
                    for (j = 0; j < H[k]; j++)
                        if ((1<<j)&letters[k][i]) ret[i+x][j+y] = '0';
                } else {
                    for (j = 0; j < H[k]; j++)
                        if ((1<<j)&letters[k][i]) ret[i+x][j+y] = '1';
                }
        }
    }
}

struct ImageScanner
{
    vector<string> restore(int _m, int _n, int _b, int _n_letter);
};

vector<string> ImageScanner::restore(int _m, int _n, int _b, int _n_letter)
{


        decode_info();

        m = _m; n = _n; b = _b; n_letter = _n_letter;
        ret = vector<string> (m, string(n, '1') );

        for (i = 0; i < m; i ++) if (i % 4 == 2) {
                ret[i] = ImageToScan::scan(i);
                open[i] = 1;
            }
/*
		for (i = 1; i < m; i += 3) {
			ret[i] = ImageToScan::scan(i);
			open[i] = 1;
		}
*/
        pixel_hunt();


        for (i = 0; i < m; i++)
            for (j = 0; j < n; j++)
                if (!open[i]) ret[i][j] = '0';

        fill_subsets();


        return ret;
}

